import React from 'react';
import '../styles/Footer.css';

const Footer = () => {
    return (
        <footer
            className="footer-container"
            style={{
                backgroundColor: '#492a40', // Cambia el fondo a un color oscuro
                color: '#f8f9fa', // Texto en blanco
                textAlign: 'center',
                padding: '1em 0',
            }}
        >
            <div className="footer-content">
                <p
                    style={{
                        fontSize: '1em', // Cambia el tamaño de la fuente
                        margin: 0,
                        fontFamily: 'Arial, sans-serif',
                    }}
                >
                    © {new Date().getFullYear()} Diseñado con{' '}
                    <span style={{ color: '#FF5733', fontWeight: 'bold' }}>❤</span> por{' '}
                    <span style={{ fontStyle: 'italic' }}>Filomena</span>. Todos los derechos reservados.
                </p>
            </div>
        </footer>
    );
};

export default Footer;
